import { BrowserRouter, Routes, Route } from "react-router-dom";

import { redirect } from "react-router-dom";

import React from "react";

const PrivateRoute = ({ children, ...args }) => {
  const auth = false;

  return (
    <Route {...args}>
      {!auth ? redirect("/login") : children}{" "}
    </Route>
  );
};

export { PrivateRoute };
